import './App.css';

import {
  BrowserRouter,
  Switch,
  Route,
} from "react-router-dom";

import { Dashboard, Products, Users } from './Screens';

const App = () => {
  <BrowserRouter>
    <Switch>

      <Route path="/">
        <Dashboard />
      </Route>

      <Route path="/products">
        <Products />
      </Route>

      <Route path="/users">
        <Users />
      </Route>

    </Switch>
  </BrowserRouter>
}

export default App;
